                    <img src={require("../img/erp-home/rocket.png")} alt=""/>
                    <h3>Experience a smarter way to close deals</h3>
                    <p>With All-in-one<span>Business</span>Manager</p>
                    <a href="/#" className="er_btn er_btn_two">Get Started Free</a>
                </div>
            </div>
        </section>
    )
}
